------------------------------------------------------------------------
-- ORDER NUMBER 10
-- 수강 정보 tblStudent


CREATE TABLE tblStudent(

    seq NUMBER NOT NULL,
    studentinfo_seq NUMBER NOT NULL,
    openclass_seq NUMBER NOT NULL,
    enroll_date DATE NOT NULL,
    finish_date DATE NULL,
    enroll_status VARCHAR2(30) NOT NULL,
    
    CONSTRAINT tblStudent_seq_pk PRIMARY KEY(seq),
    CONSTRAINT tblStudent_studentinfo_seq_fk FOREIGN KEY(studentinfo_seq) REFERENCES tblStudentInfo(seq),
    CONSTRAINT tblStudent_openclass_seq_fk FOREIGN KEY(openclass_seq) REFERENCES tblOpenClass(seq)
    
);

CREATE SEQUENCE seqStudent;

DECLARE
    v_studentinfo_seq NUMBER;
    v_openclass_seq NUMBER;
    v_enroll_date DATE;
    v_finish_date DATE;
    v_enroll_status tblStudent.enroll_status%type;
    
    v_start_date DATE;
    v_today DATE;
BEGIN

    FOR i IN 1 .. 1008 LOOP
        IF i <= 168 THEN
            v_openclass_seq := TRUNC(DBMS_RANDOM.VALUE(1, 7)); 
                
        ELSIF i >= 169 AND i <= 336 THEN
            v_openclass_seq := TRUNC(DBMS_RANDOM.VALUE(7, 13));

        ELSIF i >= 337 AND i <= 504 THEN
            v_openclass_seq := TRUNC(DBMS_RANDOM.VALUE(13, 19));
                
        ELSIF i >= 505 AND i <= 672 THEN
            v_openclass_seq := TRUNC(DBMS_RANDOM.VALUE(19, 25));
        
        ELSIF i >= 673 AND i <= 840 THEN
            v_openclass_seq := TRUNC(DBMS_RANDOM.VALUE(25, 31));
               
        ELSIF i >= 841 AND i <= 1008 THEN
            v_openclass_seq := TRUNC(DBMS_RANDOM.VALUE(31, 37));
               
        END IF;
        
        v_today := TO_DATE(SYSDATE, 'YYYY-MM-DD');
                v_studentinfo_seq := seqStudent.nextVal;
                SELECT TO_CHAR(start_date, 'YYYY-MM-DD') INTO v_start_date FROM tblOpenClass WHERE seq = v_openclass_seq;
                v_enroll_date := v_start_date - TRUNC(DBMS_RANDOM.VALUE(0, 31));
                SELECT TO_DATE(end_date,'YYYY-MM-DD') INTO v_finish_date FROM tblOpenClass WHERE seq = v_openclass_seq;
                
                IF v_start_date > v_today THEN
                    v_enroll_status := '수강예정';
                    ELSIF v_today >= v_start_date AND v_today <= v_finish_date THEN
                    v_enroll_status := '수강중';
                    ELSIF v_today > v_finish_date THEN
                    v_enroll_status := '수강완료';
                END IF;    
                IF v_finish_date >= v_today THEN
                    v_finish_date := NULL;
                END IF;
        
        VALUES(seqStudent.currVal, v_studentinfo_seq, v_openclass_seq, v_enroll_date, v_finish_date, v_enroll_status); 
        
    END LOOP;
END;
/

