-- 출결 정보 tblAttendance

select * from tblAttendance;
CREATE TABLE tblAttendance(

    SEQ NUMBER NOT NULL,
    STUDENT_SEQ NUMBER NOT NULL,
    ATTENDANCE_DATE DATE NULL,
    CHECKIN DATE NULL,
    CHECKOUT DATE NULL,
    STATE VARCHAR2(20) NOT NULL,
    
    CONSTRAINT tblAttendance_SEQ_PK PRIMARY KEY (SEQ),
    CONSTRAINT tblAttendance_STUDENT_SEQ_FK FOREIGN KEY(STUDENT_SEQ) REFERENCES tblSTUDENT(SEQ)
    
);

CREATE SEQUENCE ATTENDANCE_SEQ;

DECLARE
    v_start_date DATE := TO_DATE('2022-01-03', 'YYYY-MM-DD');
    v_end_date DATE := TO_DATE('2022-07-01', 'YYYY-MM-DD');
    v_check_in_time TIMESTAMP;                                             
    v_check_out_time TIMESTAMP;
    v_state VARCHAR2(30);
    v_student_id NUMBER;
    v_random NUMBER;
    v_current_date DATE;
    v_total_students NUMBER := 168;
    v_midway_students NUMBER := ROUND(v_total_students * 0.10);
    TYPE t_student_list IS TABLE OF NUMBER INDEX BY PLS_INTEGER;
    TYPE t_dropout_date IS TABLE OF DATE INDEX BY PLS_INTEGER;
    v_selected_students t_student_list;
    v_dropout_dates t_dropout_date;
    v_count INTEGER := 0;
    v_midway_start_date DATE := TO_DATE('2022-01-03', 'YYYY-MM-DD');
BEGIN
    DBMS_RANDOM.SEED(TO_CHAR(SYSDATE, 'YYYYMMDDHH24MISS'));
    WHILE v_count < v_midway_students LOOP
        v_student_id := ROUND(DBMS_RANDOM.VALUE(1, v_total_students));
        IF NOT v_selected_students.EXISTS(v_student_id) THEN
            v_selected_students(v_student_id) := 1;
            v_dropout_dates(v_student_id) := v_midway_start_date + ROUND(DBMS_RANDOM.VALUE(0, v_end_date - v_midway_start_date));
            v_count := v_count + 1;
        END IF;
    END LOOP;

    v_current_date := v_start_date;
    WHILE v_current_date <= v_end_date LOOP
        FOR v_student_id IN 1..v_total_students LOOP
            IF v_selected_students.EXISTS(v_student_id) THEN
                IF v_current_date >= v_dropout_dates(v_student_id) THEN
                    v_state := '중도 포기';
                    v_check_in_time := NULL;
                    v_check_out_time := NULL;
                ELSE
                    v_random := DBMS_RANDOM.VALUE;
                    IF v_random < 0.80 THEN
                        v_state := '정상';
                        v_check_in_time := TO_TIMESTAMP(v_current_date || ' 08:30:00', 'YYYY-MM-DD HH24:MI:SS') 
                                           + DBMS_RANDOM.VALUE * INTERVAL '40' MINUTE;
                        v_check_out_time := TO_TIMESTAMP(v_current_date || ' 17:50:00', 'YYYY-MM-DD HH24:MI:SS') 
                                            + DBMS_RANDOM.VALUE * INTERVAL '20' MINUTE;
                        IF DBMS_RANDOM.VALUE < 0.02 THEN
                            v_state := '외출';
                        END IF;
                    ELSIF v_random < 0.87 THEN
                        v_state := '지각';
                        v_check_in_time := TO_TIMESTAMP(v_current_date || ' 09:11:00', 'YYYY-MM-DD HH24:MI:SS') 
                                           + DBMS_RANDOM.VALUE * INTERVAL '3' HOUR;
                        v_check_out_time := TO_TIMESTAMP(v_current_date || ' 17:50:00', 'YYYY-MM-DD HH24:MI:SS') 
                                            + DBMS_RANDOM.VALUE * INTERVAL '20' MINUTE;
                    ELSIF v_random < 0.94 THEN
                        v_state := '조퇴';
                        v_check_in_time := TO_TIMESTAMP(v_current_date || ' 08:30:00', 'YYYY-MM-DD HH24:MI:SS') 
                                           + DBMS_RANDOM.VALUE * INTERVAL '40' MINUTE;
                        v_check_out_time := TO_TIMESTAMP(v_current_date || ' 13:00:00', 'YYYY-MM-DD HH24:MI:SS') 
                                            + DBMS_RANDOM.VALUE * INTERVAL '4' HOUR;
                    ELSIF v_random < 0.95 THEN
                        v_state := '병가';
                        v_check_in_time := NULL;
                        v_check_out_time := NULL;
                    ELSE
                        v_state := '결석';
                        v_check_in_time := NULL;
                        v_check_out_time := NULL;
                    END IF;
                END IF;
            ELSE
                v_random := DBMS_RANDOM.VALUE;
                IF v_random < 0.80 THEN
                    v_state := '정상';
                    v_check_in_time := TO_TIMESTAMP(v_current_date || ' 08:30:00', 'YYYY-MM-DD HH24:MI:SS') 
                                       + DBMS_RANDOM.VALUE * INTERVAL '40' MINUTE;
                    v_check_out_time := TO_TIMESTAMP(v_current_date || ' 17:50:00', 'YYYY-MM-DD HH24:MI:SS') 
                                        + DBMS_RANDOM.VALUE * INTERVAL '20' MINUTE;
                    IF DBMS_RANDOM.VALUE < 0.02 THEN
                        v_state := '외출';
                    END IF;
                ELSIF v_random < 0.87 THEN
