CREATE TABLE tblProject(

    seq NUMBER NOT NULL,
    name VARCHAR2(100) NULL,
    start_date DATE NOT NULL,
    end_date DATE NULL,
    
    CONSTRAINT tblProject_seq_pk PRIMARY KEY(seq)

);


CREATE SEQUENCE seqProject;

DECLARE
    v_start_date DATE;
    v_end_date DATE;
    vrnd_start NUMBER;
    vrnd_end NUMBER;
BEGIN
    FOR i IN 1 .. 1008 LOOP

-- vrnd는 프로젝트 기간을 일(day) 단위로 나타내는 변수.
-- 값의 범위는 10일 ~ 학기 말일
-- (DBMS_RANDOM.Value(10,180))
-- 첫번째 인자 값인 10은 학기 시작 후 10일 뒤를 나타냄.
-- 두번째 인자 값인 180은 학기 말일을 나타냄. 180 또는 187은 하드코딩 값.

        IF i <= 168 THEN
            
            vrnd_start := TRUNC(dbms_random.value(0,20));
            v_start_date := TO_DATE('2022-01-03', 'YYYY-MM-DD') + vrnd_start;
            vrnd_end := TRUNC(dbms_random.value(10,160));
            v_end_date := v_start_date + vrnd_end;
            VALUES(seqProject.nextVal, '프로젝트 ' || seqProject.currVal, v_start_date, v_end_date);
        
        ELSIF i >= 169 AND i <= 336 THEN
            
            vrnd_start := TRUNC(dbms_random.value(0,20));
            v_start_date := TO_DATE('2022-07-04', 'YYYY-MM-DD') + vrnd_start;
            vrnd_end := TRUNC(dbms_random.value(10,167));
            v_end_date := v_start_date + vrnd_end;
            VALUES(seqProject.nextVal, '프로젝트 ' || seqProject.currVal, v_start_date, v_end_date);
        
        ELSIF i >= 337 AND i <= 504 THEN
            
            vrnd_start := TRUNC(dbms_random.value(0,20));
            v_start_date := TO_DATE('2023-01-09', 'YYYY-MM-DD') + vrnd_start;
            vrnd_end := TRUNC(dbms_random.value(10,167));
            v_end_date := v_start_date + vrnd_end;
            VALUES(seqProject.nextVal, '프로젝트 ' || seqProject.currVal, v_start_date, v_end_date);
        
        ELSIF i >= 505 AND i <= 672 THEN
        
            vrnd_start := TRUNC(dbms_random.value(0,20));
            v_start_date := TO_DATE('2023-07-10', 'YYYY-MM-DD') + vrnd_start;
            vrnd_end := TRUNC(dbms_random.value(10,167));
            v_end_date := v_start_date + vrnd_end;
            VALUES(seqProject.nextVal, '프로젝트 ' || seqProject.currVal, v_start_date, v_end_date);
        
        ELSIF i >= 673 AND i <= 840 THEN
            
            vrnd_start := TRUNC(dbms_random.value(0,20));
            v_start_date := TO_DATE('2024-01-08', 'YYYY-MM-DD') + vrnd_start;
            vrnd_end := TRUNC(dbms_random.value(10,167));
            v_end_date := v_start_date + vrnd_end;                
            VALUES(seqProject.nextVal, '프로젝트 ' || seqProject.currVal, v_start_date, v_end_date);
        
        ELSIF i >= 841 AND i <= 1008 THEN
            
            /*
            해당 ELSIF 구절은 현재 학기(6학기)여서 아직 학기가 끝나지 않음.
            v_end_date의 최댓값이 학기 마지막일인데 아직 학기 마지막일이 오지 않음.
            그래서 아래 v_end_date의 최댓값을 SYSDATE(오늘)로 하기보다는 아직 끝나지 않은 프로젝트로 보고
            v_end_date > SYSDATE 이면 그냥 v_end_date를 NULL 처리 (아직 프로젝트가 끝나지 않았다는 뜻)
            */
            vrnd_start := TRUNC(dbms_random.value(0,20));
            v_start_date := TO_DATE('2024-07-08', 'YYYY-MM-DD') + vrnd_start;
            vrnd_end := TRUNC(dbms_random.value(10,167));
            --vrnd := TRUNC(dbms_random.value(10,TO_DATE(SYSDATE, 'YYYY-MM-DD') - v_start_date));
            v_end_date := v_start_date + vrnd_end;
            IF v_end_date > TO_CHAR(SYSDATE, 'YYYY-MM-DD') THEN
            v_end_date := NULL;
            END IF;
            VALUES(seqProject.nextVal, '프로젝트 ' || seqProject.currVal, v_start_date, v_end_date);
            
       
        END IF;
    END LOOP;
END;
/

