---- ORDER NUMBER 43
---- 교육생-프로젝트 관계 tblProject_Student
CREATE TABLE tblProject_Student(

    seq NUMBER NOT NULL,
    project_seq NUMBER NOT NULL,
    student_seq NUMBER NOT NULL,
    
    CONSTRAINT tblP_S_seq_pk PRIMARY KEY(seq),
    CONSTRAINT tblP_S_project_seq_fk FOREIGN KEY(project_seq) REFERENCES tblProject(seq),
    CONSTRAINT tblP_S_student_seq_fk FOREIGN KEY(student_seq) REFERENCES tblStudent(seq)
    
);

CREATE SEQUENCE seqProject_Student;

DECLARE
    TYPE SeqArray IS TABLE OF NUMBER INDEX BY PLS_INTEGER;
    v_student_seqs SeqArray;
    v_project_seqs SeqArray;
    v_counts SeqArray;
    v_insert_count NUMBER := 0;
    v_max_per_project CONSTANT NUMBER := 4;
    i PLS_INTEGER;
    
    v_project_seq NUMBER;
    v_student_seq NUMBER;
    v_group_start NUMBER;
    v_group_end NUMBER;
    v_rand_index NUMBER;
    group_num PLS_INTEGER;  -- Explicit declaration of group_num
BEGIN
    -- Initialize counts and student sequences
    FOR i IN 1 .. 1008 LOOP
        v_counts(i) := 0;
        v_student_seqs(i) := i;  -- Initialize student sequences with the same value
    END LOOP;

    -- Loop over groups, randomizing students within the group and assigning them to projects
    FOR group_num IN 1 .. 6 LOOP  -- Implicit declaration of group_num
        v_group_start := (group_num - 1) * 168 + 1;
        v_group_end := group_num * 168;

        -- Shuffle students within the group
        FOR i IN v_group_start .. v_group_end LOOP
            v_rand_index := TRUNC(DBMS_RANDOM.VALUE(v_group_start, v_group_end + 1));
            -- Swap the current student with a random student within the group
            IF v_rand_index <> i THEN
                v_student_seq := v_student_seqs(i);
                v_student_seqs(i) := v_student_seqs(v_rand_index);
                v_student_seqs(v_rand_index) := v_student_seq;
            END IF;
        END LOOP;

        -- Assign shuffled students to projects
        FOR i IN v_group_start .. v_group_end LOOP
            v_project_seq := i;

            -- Insert 4 students per project
            FOR j IN 1 .. v_max_per_project LOOP
                v_student_seq := v_student_seqs((i - v_group_start) * v_max_per_project + j);

                VALUES(seqProject_Student.nextVal, v_project_seq, v_student_seq);

                -- Update the count
                v_counts(v_project_seq) := v_counts(v_project_seq) + 1;
                v_insert_count := v_insert_count + 1;
            END LOOP;
        END LOOP;
    END LOOP;
END;
/
