---- 취업생 정보 통계 tblEmployment
CREATE TABLE tblEmployment(
    
    seq NUMBER NOT NULL,
    student_seq NUMBER NOT NULL,
    company_seq NUMBER NOT NULL,
    start_date DATE NOT NULL,
    end_date DATE NULL,
    salary NUMBER NULL, 
    working_hour NUMBER NULL,
    
    CONSTRAINT tblEmployment_seq_pk PRIMARY KEY(seq),
    CONSTRAINT tblEmployment_student_seq_fk FOREIGN KEY(student_seq) REFERENCES tblStudent(seq),
    CONSTRAINT tblEmployment_company_seq_fk FOREIGN KEY(company_seq) REFERENCES tblCompany(seq)
    
);

CREATE SEQUENCE seqEmployment;

declare
    v_student_seq NUMBER;
    v_company_seq NUMBER;
    v_start_date DATE;
    v_end_date DATE;
    v_salary NUMBER;
    v_working_hour NUMBER;
    
    v_cmin NUMBER;
    v_cmax NUMBER;
    v_today DATE;
    v_openclass_seq NUMBER;
    v_random NUMBER;
    v_number NUMBER;

begin
    
    v_today := TO_DATE(SYSDATE, 'YYYY-MM-DD');  
    v_cmin := 1;
    SELECT COUNT(*) INTO v_cmax FROM tblCompany;
    
    FOR i IN 1 .. 1008 LOOP
        v_student_Seq := i;
        v_company_seq := TRUNC(dbms_random.value(v_cmin,v_cmax));
        SELECT openclass_seq INTO v_openclass_seq FROM tblStudent WHERE seq = i;
        SELECT TO_DATE(end_date, 'YYYY-MM-DD') into v_start_date FROM tblOpenClass WHERE seq = v_openclass_seq;
        v_start_date := v_start_date + TRUNC(dbms_random.value(1,30));
        v_number := v_today - v_start_date;
        
        v_random := DBMS_RANDOM.VALUE;
        
        IF v_random <0.90 THEN
        v_end_date := NULL;
        ELSE
        v_end_date := v_start_date + TRUNC(dbms_random.value(30,v_number));
        END IF;
        v_salary := TRUNC(dbms_random.value(250,401));
        v_working_hour := TRUNC(dbms_random.value(130,221));
        
        VALUES(seqEmployment.nextVal, v_student_seq, v_company_seq, v_start_date, v_end_date, v_salary, v_working_hour);
        
    END LOOP;
    
end;
