-- 취업특강 tblWorkshop
-- 취업특강은 한 달에 한 번 진행하고 이미 개설 과정을 수료한 학생이 초청인사로 와야 하므로
-- 첫 학기가 아닌 두번째 학기 첫 달 부터 시작하며 각 달에 말일에 진행합니다.
-- ex) 교육원이 처음 개강한 22년 1월 학기부터가 아닌 22년 7월 학기부터 특강 진행
-- 아직 진행하지 않은 취업 특강은 학기말일 직전 달 기준까지만 미리 등록됩니다.
-- ex) 현재 2024년 8월이고 현재 학기 수업은 모두 2025년 1월에 종료되므로
-- ex) 이번 학기 마지막 달인 25년 1월에 이전 달인 24년 12월까지만 취업특강이 계획 되어있습니다.
select * from tblworkshop;
CREATE TABLE tblWorkshop(

    seq NUMBER NOT NULL,
    classroom_seq NUMBER NOT NULL,
    name VARCHAR2(50) NOT NULL,
    workshop_date DATE NOT NULL,
    
    CONSTRAINT tblWorkshop_seq_pk PRIMARY KEY(seq),
    CONSTRAINT tblWorkshop_classroom_seq_fk FOREIGN KEY(classroom_seq) REFERENCES tblClassroom(seq)

);


CREATE SEQUENCE seqWorkshop;

DECLARE

    v_workshop_min_date DATE;
    v_workshop_max_date DATE;
    v_workshop_date DATE;
    v_today DATE;
    v_end_date DATE;

BEGIN

    v_today := TO_DATE(SYSDATE, 'YYYY-MM-DD');
    v_workshop_max_date := LAST_DAY(v_today);
    v_workshop_min_date := LAST_DAY(TO_DATE('2022-06-01', 'YYYY-MM-DD'));
    v_workshop_date := v_workshop_min_date;
    
    SELECT MAX(end_date) INTO v_end_date FROM tblOpenClass;
    v_end_date := ADD_MONTHS(LAST_DAY(v_end_date), -1);

    
    LOOP
    v_workshop_date := ADD_MONTHS(v_workshop_date, 1);  
    VALUES(seqWorkshop.nextVal, TRUNC(DBMS_RANDOM.VALUE(1, 7)), '취업특강 ' || seqWorkshop.currVal, v_workshop_date);
    
    EXIT WHEN v_workshop_date >= v_end_date;
    END LOOP;

END;
/


