---- 상수
--------------------------------------------------------------------------
--------------------------------------------------------------------------
---- ORDER NUMBER 47
---- 취업특강 초청 취업생 tblWorkshop_Guest
-- 일단 취업 특강 1명당 초청인사 10명만 오는 걸로 설정했습니다.
-- 한 학기당 총 6개의 특강이 진행되며 각 학기마다 초청 가능한 사람 조건은 최소 이전 학기에 과정을 수강한 사람이어야 합니다.
-- 현재 과정을 수강하고 있는 사람은 초청인사가 될 수 없습니다.

CREATE TABLE tblWorkshop_Guest(

    seq NUMBER NOT NULL,
    workshop_seq NUMBER NOT NULL,
    employment_seq NUMBER NOT NULL,
    
    CONSTRAINT tblW_G_seq_pk PRIMARY KEY(seq),
    CONSTRAINT tblW_G_employment_seq_fk FOREIGN KEY(employment_seq) REFERENCES tblEmployment(seq),
    CONSTRAINT tblW_G_workshop_seq_fk FOREIGN KEY(workshop_seq) REFERENCES tblWorkshop(seq),
    CONSTRAINT tblW_G_work_empl_uniq UNIQUE(workshop_seq, employment_seq)
);

CREATE SEQUENCE seqWorkshop_Guest;

DECLARE

    v_employment_seq NUMBER;
    j NUMBER;
    
BEGIN

    FOR i in 1 .. 30 LOOP
        j := 1;  -- Start j at 1 for each i iteration
        WHILE j <= 10 LOOP
        
            IF i BETWEEN 1 AND 6 THEN
                v_employment_seq := TRUNC(DBMS_RANDOM.VALUE(1, 169));
            ELSIF i BETWEEN 7 AND 12 THEN
                v_employment_seq := TRUNC(DBMS_RANDOM.VALUE(1, 337));
            ELSIF i BETWEEN 13 AND 18 THEN
                 v_employment_seq := TRUNC(DBMS_RANDOM.VALUE(1, 505));
            ELSIF i BETWEEN 19 AND 24 THEN
                 v_employment_seq := TRUNC(DBMS_RANDOM.VALUE(1, 673));
            ELSIF i BETWEEN 25 AND 30 THEN
                 v_employment_seq := TRUNC(DBMS_RANDOM.VALUE(1, 841));
            END IF;
            
            BEGIN
                VALUES(seqWorkshop_Guest.nextVal, v_employment_seq, i);
                
                -- Increment j only on successful insertion
                j := j + 1;

            EXCEPTION
                WHEN DUP_VAL_ON_INDEX THEN
                    -- Do nothing, just retry the insertion
                    NULL;
            END;
            
        END LOOP;
    END LOOP;
    
END;
/


--
---- 상수
--------------------------------------------------------------------------
--------------------------------------------------------------------------
---- ORDER NUMBER 48
---- 취업특강 신청생 tblWorkshop_Student
-- 한 취업 특강당 강의실 최대 수용인원만큼 올 수 있습니다.
-- 각 취업 특강은 신청생은 해당 취업특강이 있는 학기에 과정을 수강 중인 수강생에 한해서만 신청 가능합니다.

CREATE TABLE tblWorkshop_Student(

    seq NUMBER NOT NULL,
    workshop_seq NUMBER NOT NULL,
    student_seq NUMBER NOT NULL,
    
    CONSTRAINT tblW_S_seq_pk PRIMARY KEY(seq),
    CONSTRAINT tblW_S_workshop_seq_fk FOREIGN KEY(workshop_seq) REFERENCES tblWorkshop(seq),
    CONSTRAINT tblW_S_student_seq_fk FOREIGN KEY(student_seq) REFERENCES tblStudent(seq)    

);

DROP SEQUENCE seqWorkshop_Student;
CREATE SEQUENCE seqWorkshop_Student;

DECLARE

    v_workshop_seq NUMBER;
    v_student_seq NUMBER;
    v_count NUMBER;
    v_check NUMBER;
    v_capacity NUMBER;
    v_classroom_seq NUMBER;
    v_num NUMBER;
    
BEGIN

    v_num := 168;
    v_count := 0;
    
    FOR i in 1 .. 30 LOOP
        v_count := 0;
        v_workshop_seq := i;
        SELECT classroom_seq INTO v_classroom_seq FROM tblWorkshop WHERE seq = i;
        SELECT capacity INTO v_capacity FROM tblClassroom WHERE seq = v_classroom_seq;
        
            WHILE v_count <= v_capacity LOOP
                
                IF i BETWEEN 1 AND 6 THEN
                    v_student_seq := TRUNC(DBMS_RANDOM.VALUE(v_num, v_num * 2)) + 1;
                ELSIF i BETWEEN 7 AND 12 THEN
                    v_student_seq := TRUNC(DBMS_RANDOM.VALUE(v_num * 2, v_num * 3)) + 1;
                ELSIF i BETWEEN 13 AND 18 THEN
                    v_student_seq := TRUNC(DBMS_RANDOM.VALUE(v_num * 3, v_num * 4)) + 1;
                ELSIF i BETWEEN 19 AND 24 THEN
                    v_student_seq := TRUNC(DBMS_RANDOM.VALUE(v_num * 4, v_num * 5)) + 1;
                ELSIF i BETWEEN 25 AND 30 THEN
                    v_student_seq := TRUNC(DBMS_RANDOM.VALUE(v_num * 5, v_num * 6)) + 1;
                END IF;

                SELECT COUNT(*) INTO v_check FROM tblWorkshop_Student 
                WHERE student_seq = v_student_seq AND workshop_seq = v_workshop_seq;
                
                IF v_check = 0 THEN
                    VALUES(seqWorkshop_Student.nextVal, v_workshop_seq, v_student_seq);
                END IF;
                v_count := v_count + 1;
            END LOOP;
    END LOOP;
    
END;
/


