INSERT INTO tblJobBox(seq, title, content, creation_date, like_count, dislike_count) VALUES (JOBBOX_SEQ.NEXTVAL, '면접관을 사로잡는 면접노하우', '오늘은 크리스피드(주)의 김우 전무님께서 면접 특강을 진행해 주시는 날입니다. 관심있으신 분들은 신청 바랍니다.', '2024-07-25', 230, 0);
INSERT INTO tblJobBox(seq, title, content, creation_date, like_count, dislike_count) VALUES (JOBBOX_SEQ.NEXTVAL, '비전 있는 선택 - 필라웨어', '필라웨어는 숙련된 IT 개발 기술과 시스템 운영 노하우를 바탕으로, 다양한 비즈니스 영역에서 새로운 지식 창출을 실현하여 고객 기업의 가치 극대화와 경쟁력 강화를 위한 전반적인 IT 서비스를 지원하고 있으며 가상화 솔루션 벤더의 Premier Partner로서, 최고의 기술 파트너로 자리매김하며 2020년 VMware Digital Workspace Solution 개발로 보다 신속하고 안전하게 디지털 업무 공간을 혁신한 기업입니다.', '2024-06-12', 1000, 4);
INSERT INTO tblJobBox(seq, title, content, creation_date, like_count, dislike_count) VALUES (JOBBOX_SEQ.NEXTVAL, 'ICT 통합 보안 선도기업 라온시큐어와 함께하는 취업특강', '오늘은 라온시큐어의 박한표 차장님께서 면접 특강을 진행해 주시는 날입니다. 관심있으신 분들은 신청 바랍니다.', '2024-05-13', 0, 0);
INSERT INTO tblJobBox(seq, title, content, creation_date, like_count, dislike_count) VALUES (JOBBOX_SEQ.NEXTVAL, '자기소개서, 어떻게 쓸 것인가?', '에스컴 이선주 이사님께서 자기소개서 특강을 진행할 예정입니다. 많은 관심 부탁드립니다.', '2023-12-27', 60, 5);
INSERT INTO tblJobBox(seq, title, content, creation_date, like_count, dislike_count) VALUES (JOBBOX_SEQ.NEXTVAL, '빅데이터란 무엇인가?', 'MOS의 이종립CTO를 모시고 빅데이터에 관한 특강을 진행할 예정입니다. 많은 관심 부탁드립니다.', '2023-09-05', 1000, 5);
